import React from 'react';
import SQLTable from '../Shared/SQLTable';
import { Select, MenuItem } from '@material-ui/core';

export default class DoctorPanel extends React.Component {
    constructor(props) {
        super(props)
        this.headers = []
        this.rows = []
        this.ready = true
        this.clickedRows = []
    }

    reload = () => {
        this.ready = false
        this.forceUpdate()
    }

    onRowClick = (rows) => {
        this.clickedRows = rows
    }

    render = () => {
        return(
            <div>
                {this.headers && this.rows && this.ready && (
                    <SQLTable headers={this.headers} rows={this.rows} onRowClick={this.onRowClick} selectRowChecbox='true'>
                        <Select
                        labelId="demo-simple-select-label"
                        value={10}
                        onChange={() => alert(1)}
                        >
                            <MenuItem value={10}>Ten</MenuItem>
                            <MenuItem value={20}>Twenty</MenuItem>
                            <MenuItem value={30}>Thirty</MenuItem>
                         </Select>
                    </SQLTable>
                )}
            </div>
        )
    }
}
